import React from "react";
import { Link } from "react-router-dom";
const Navbar = () => {
	return (
		<div>
			<li>
				<Link to="/">Home</Link>
			</li>
			<li>
				<Link to="/about">About</Link>
			</li>
			<li>
				<Link to="/blog">Blog</Link>
			</li>
			<li>
				<Link to="/signup">Signup</Link>
			</li>
			<li>
				<Link to="/login">Login</Link>
			</li>
		</div>
	);
};
export default Navbar;
